import React, { useState, useCallback } from "react";
import { Navbar, Button, Modal, Form } from "react-bootstrap";

export default function Nav() {
  const [show, setShow] = useState(null);
  const [showRegister, setShowRegister] = useState(null);
  const [email, setEmail] = useState("");
  const [name, setName] = useState("");
  const [password, setPassord] = useState("");

  const loginFunc = useCallback((e) => {
    e.preventDefault();
    setShow(false);
  });

  const loginShow = (e) => {
    setShow(e);
  };

  const registerShow = (e) => {
    setShowRegister(e);
  };

  return (
    <div>
      <Navbar className="navBar">
        <div className="container">
          <Navbar.Brand href="/" className="navText">
            JoinMe<i class="fas fa-users"></i>
          </Navbar.Brand>
          <Form inline>
            <Button onClick={() => loginShow(true)}>Login</Button>
            <Button onClick={() => registerShow(true)}>Register</Button>
          </Form>
        </div>
      </Navbar>
      <Modal show={show}>
        <Modal.Header>Login Modal</Modal.Header>
        <Modal.Body>
          <Form onSubmit={() => loginFunc()}>
            <Button onClick={() => loginShow(false)}>Cancel</Button>
            <Button type="submit">Login</Button>
          </Form>
        </Modal.Body>
      </Modal>
      <Modal show={showRegister}>
        <Modal.Header>Register Modal</Modal.Header>
        <Modal.Body>
        <Form.Group controlId="title">
          <Form.Label>Title</Form.Label>
          <Form.Control
            type="text"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
          />
        </Form.Group>
        <Form.Group controlId="title">
          <Form.Label>Title</Form.Label>
          <Form.Control
            type="text"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
          />
        </Form.Group>
        <Form.Group controlId="title">
          <Form.Label>Title</Form.Label>
          <Form.Control
            type="text"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
          />
        </Form.Group>
          <Form onSubmit={() => loginFunc()}>
            <Button onClick={() => registerShow(false)}>Cancel</Button>
            <Button type="submit">Register</Button>
          </Form>
        </Modal.Body>
      </Modal>
    </div>
  );
}
